import React from 'react';
import axios from 'axios';
import { List, Typography } from 'antd';

const admin = () => {
    const data = [
        {
            name: '아무개',
            phone: '010-2323-2193'
        },
        {
            name: '홍길동',
            phone: '010-1211-1232'
        },
      ];
    return (
        <>
            <div>
                <h3 style={{ margin: '16px 0' }}>신청자 목록</h3>
                <List
                size="large"
                bordered
                dataSource={data}
                renderItem={item => <List.Item>{item.name}{item.phone}</List.Item>}
                />
            </div>  
        </>
    )
}

export default admin;
